import React from "react";
import { Outlet } from "react-router-dom";
import Grid from "@mui/joy/Grid";

export default function Appartamento() {
  return (
    <Grid
      container
      style={{
        height: "100vh",
        width: "100wh",
        overflow: "auto",
      }}
    >
      <Grid
        container
        style={{
          height: "100%",
          width: "25%",
          backgroundColor: "rgb(144, 35, 50)",
        }}
      ></Grid>
      <Grid
        style={{
          height: "100%",
          width: "80%",
          backgroundColor: "rgb(44, 135, 50)",
        }}
      >
        <Outlet />
      </Grid>
    </Grid>
  );
}
